script: |
  super -f text -I q2366.spq | sort > q2366.out

inputs:
  - name: q2366.spq
    data: |
      SELECT + + 16 - - - ( COUNT ( * ) ) / + + 20 * - 16 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q2366.out
    data: |
      16
